  const allTodos = todos();
  const currentFilter = filter();
  
  switch (currentFilter) {
    case 'active':
      return allTodos.filter(todo => !todo.completed);
    case 'completed':
      return allTodos.filter(todo => todo.completed);
    default:
      return allTodos;
  }
