const createDebouncedEffect = <T>(
  computation: () => T,
  delay: number,
  name: string
) => {
  let timeoutId: number | null = null;
  
  return effect(() => {
    // Clear previous timeout
    if (timeoutId) {
      clearTimeout(timeoutId);
    }
    
    // Set new timeout
    timeoutId = window.setTimeout(() => {
      computation();
      timeoutId = null;
    }, delay);
    
    return () => {
      if (timeoutId) {
        clearTimeout(timeoutId);
        timeoutId = null;
      }
    };
  }, { name });
};

