    todoStore.addTodo();
    
    // Complete one
    todoStore.toggleTodo(todoStore.todos.value[0].id);
    
    expect(todoStore.totalCount.value).toBe(2);
    expect(todoStore.activeCount.value).toBe(1);
    expect(todoStore.completedCount.value).toBe(1);
